import React from 'react'
import {PokemonCardContainer, ImgContainer} from './styled'

const PokemonCard = () => {
    return(
        <PokemonCardContainer>
          <ImgContainer>
            <img/>
          </ImgContainer>
          
            <p>Pikachu</p>
          
        </PokemonCardContainer>
    )
}
export default PokemonCard
